import css from './navigation.module.scss';

 const Navigation = () =>{
    return(
        <nav>
        <ul className={css.nav}>
            <li>
                Home
            </li>
            <li>products</li>
            <li>
                services
                </li>
            </ul>
        </nav>
    )
}

export default Navigation;
